import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import PrmNavBar from "./PrmNavBar";
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import Button from 'react-bootstrap/Button';




class ImsScripts extends React.Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div class="prm-background">
        <PrmNavBar></PrmNavBar>
    <List >
          <ListItem>
              <Button href="http://localhost:3000/imsscripts/naming-conventions" style={btnStyle}>Go</Button>
              <ListItemText primary="Naming conventions" secondary="Online app for naming conventions in IMS projects" />
          </ListItem>

          <ListItem>
              <Button href="http://localhost:3000/imsscripts/walloffameims" style={btnStyle}>Go</Button>
              <ListItemText primary="Wall Of Fame for IMS" secondary="" />
          </ListItem>

          <ListItem>
              <Button href="http://localhost:3000/imsscripts/folder-structure" style={btnStyle}>Go</Button>
              <ListItemText primary="Folder Structure" secondary="" />
          </ListItem>
    </List>
      </div>
    );
  }
}

const btnStyle={
  margin:10,
}

export default ImsScripts;
